syntax = "proto3";

package v1;

option go_package = "github.com/nokamoto/protobuf-test-202401/gen/proto/v1";

message SuperSet {
  int32 first = 1;
  int32 third = 3;
}

message Wrapper {
  SuperSet set = 1;
}

message A {
  string a = 1;
  SuperSet b = 2;
  repeated SuperSet c = 3;
  repeated Wrapper d = 4;
}
